import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import React, {useState} from 'react'

const Expenses = (props) => {
  let finalDiv = [];
  const [updatedExpenses,setExpenses] = useState({})

  for (let i = 0; i < props.expenses.length; i++) {
    finalDiv = [...finalDiv,<ExpenseItem title={props.expenses[i].title} amount={props.expenses[i].amount} date={props.expenses[i].date}/>];
    
  }

  return (<Card className ="expenses">{finalDiv}</Card>);
}

export default Expenses;
